
import time

def get_user_information(client,user_id):
    try:
        response = client.users_info(user=user_id)
        if response["ok"]:
            user_info = response["user"]
            name = user_info["real_name"]  # Full name
            email = user_info["profile"]["email"]  # Email address
            confirmation_status = user_info["is_email_confirmed"]
            user_details = {"name": name, "email": email,"confirmation_status":confirmation_status}
            return user_details
        else:
            print("Error:", response["error"])
            return None
    except Exception as e:
        print("Exception:", e)
        return None

def get_sessions(client,channel_id):
  try:
    current_time = time.time()  # Current timestamp
    one_hour_ago = current_time - (1 * 60 * 60)  # One hour ago
    result = client.conversations_history(channel=channel_id,oldestr=str(one_hour_ago),limit=10)
    conversation_history = result["messages"]
    # Print results
    print("{} messages found in {}".format(len(conversation_history), channel_id))
    recorded_history=[{'user':c.get('user'),'text':c.get('text'),'ts':c.get('ts')} for c in conversation_history]
    return recorded_history
  except Exception as e:
    print("Error creating conversation: {}".format(e))
    return None
  
